import Layout from '../../components/Layout';

const Admin = () => {
    const adminHead = () => {
        return (
            <React.Fragment>
                <h1>Admin Page</h1>
                <br />
            </React.Fragment>
        ) 
    }
    return (
        <Layout>
            
            <div className="col-md-6 offset-md-3">
                {adminHead()} 
                <hr/>
            </div> 
        </Layout>
    )
}

export default Admin;
